        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Spånga IP är belägen i vackra Spångadalen. Anläggningen invigdes 1977 och har ett regionalt ansvarsområde när det gäller fotboll, bandy och friidrott. För spontana idrottsutövare kan man under sommartid spela basket eller ta några löparvarv på den fina rundbanan som har allvädersbeläggning. Vintertid kan man sätta på sig skridskorna och utnyttja idrottsplatsens tider för allmänheten.\r\n\r\nNu har vi även öppnat upp ett utegym, som är öppet för allmänheten. \r\n\r\nFör mer information om allmänhetens skridskoåkning, www.stockholm.se/skridsko",
