        "Name": "Mer om enheten",
        "Value": "Rålis Skatepark blev verklighet efter ett medborgarförslag och öppnades 2010. Vi vill att många ska ha glädje av den under lång tid. Här kan du åka med skateboard, sparkcykel, inlines eller liknande.\r\n\r\nTänk på att inte använda åkslag som smutsar ner eller förstör parken.\r\n\r\nTRIVSELREGLER\r\n• All åkning i betongparken sker på egen risk\r\n• Visa hänsyn och respekt till andra åkare och åkslag\r\n• Hjälm och andra skydd bör alltid användas\r\n• Publik och vilande åkare ska uppehålla sig utanför pooler och åkytor.\r\n• Barn ska alltid vara under uppsikt av vuxen\r\n\r\nUNDERHÅLL\r\n• Hjälp oss att hålla betongparken ren från grus och annat som hindrar åkningen\r\n• Parken snöröjs inte\r\n\r\nFelanmälan görs via telefon 08-651 00 00 eller www.stockholm.se/felanmalan. Synpunkter kan också lämnas via Stockholms stads mobilapp Tyck till.\r\n\r\nVid olycka ring 112.",
