        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Längs det belysta spåret i Sätraskogen finns ett spår för barn i närheten av Mälarhöjdsbadet bredvid Bredängs camping.\r\n\r\nPå barnspåret finns 34 stationer som uppmuntrar till aktiviteter och samtal om naturen i Sätraskogen. På varje station finns ett uppdrag eller en fråga som handlar om allemansrätten, rörelser att göra i skogen eller vad sinnena kan upptäcka. \r\n\r\nPassa gärna på att använda utegymmet vid Mälarhöjdsbadet. Ni kan läsa mer om utegymmet på jämför service under utegym eller följ länken under relaterade länkar.\r\n\r\nBelysningen är på till kl.22.00\r\n\r\nDe parkeringsplatser som ligger nära finns vid Mälarhöjdsbadet och vid Bredängs Camping.",
