        "Name": "Ordinarie öppettider",
        "ServiceUnitTypeInfo": {
          "Id": "10031f76-001a-4a00-9e2a-3b1a166ebf6f",
          "SingularName": "Simhall",
        },
        "Value": "Ordinarie öppettider för simhall, gym och gruppträning:\r\n\r\nObservera att tiderna nedan anger sista inpasseringstid. Det är möjligt att träna/simma 30 min efter sista inpasseringstid. 60 min efter sista inpasseringstid skall samtliga besökare ha lämnat anläggningen.\r\n\r\nSimhall\r\nMåndag 06:30 - 20:00\r\nTisdag 06:30 - 20:00\r\nOnsdag 12:15 - 18:00*\r\nTorsdag 06:30 - 18:00\r\nFredag 06:30 - 18:00\r\nLördag 08:00 - 15:00\r\nSöndag 11:00 - 17:00\r\n\r\nUndervisningsbassängen\r\nMåndag 18:00-20:00\r\nTisdag 14:30-17:00\r\nOnsdag 17:00-18:00*\r\nTorsdag 14:30-18:00\r\nFredag 14:00-18:00\r\nLördag 12:00-15:00\r\nSöndag 11:00-17:00**\r\n\r\nGym\r\nMåndag 06:30-20:00\r\nTisdag 06:30-20:00\r\nOnsdag 12:15-20:00\r\nTorsdag 06:30-20:00\r\nFredag 06:30-18:00\r\nLördag 08:00-15:00\r\nSöndag 11:00-17:00\r\n\r\nKvinnogymmet är öppet:\r\nMåndag 06:30 - 19:30\r\nTisdag 06:30 - 19:30\r\nOnsdag 12:15 - 19:30\r\nTorsdag 06:30 - 19:30\r\nFredag 06:30 - 17:30\r\nLördag 08:00 - 14:30\r\nSöndag 11:00 - 16:30\r\n\r\n*Kvinnosim, endast kvinnor i simhallen: \r\nOnsdag: 12:15-14:50 (åldersgräns 13 år - endast vattengympa 13:00-13:45)\r\nOnsdag: 15:30-17:30 (åldersgräns 4 år endast flickor)\r\nObs! Begränsat antal platser i båda grupperna.\r\n\r\n**Ej motionssim på söndagar mellan 12.00-14.00",
