        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Svedmyrabadet finns på Handelsvägen 186 i Enskede, tfn 08-39 07 24 och har öppet enligt nedanstående.\r\n\r\nI ett härligt 32-34-gradigt vatten kan du träna vattengympa i grupp eller enskilt, eller bada på våra relaxtider i skenet av levande ljus. Vårdpersonal finns på plats som vid behov kan hjälpa dig med eventuell personlig assistans.\r\n\r\nHjärtligt välkomna!\r\n\r\nÖPPETTIDER\r\n\r\nMåndag:          07.30-11.15   Bad\r\n                 12.30-13.30 Vattengympa\r\n                 13.30-17.30 Bad\r\n                 17.30-18.30 Vattengympa\r\n                 18.30-20.00 Relaxbad\r\n\r\nTisdag:          07.00-11.30 Bad\r\n                 11.30-12.30 Vattengympa\r\n                 16.30-17.30 Vattengympa\r\n                 17.30-21.00 Bad\r\n\r\nOnsdag:          07.30-11.30 Bad\r\n                 11.30-12.30 Vattengympa\r\n                 12.30-15.30 Bad\r\n                 16.30-18.00 Bad\r\n                 18.00-18.45 Vattengympa\r\n                 18.30-20.00 Bad\r\n\r\nTorsdag:         07.00-10.00 Bad\r\n                 12.00-17.00 Bad\r\n                 17.00-18.00 Vattengympa\r\n                 18.00-21.00 Bad\r\n\r\nFredag:          11.00-12.00 Vattengympa\r\n                 12.00-15.00 Bad\r\n                 16.00-17.00 Ai-Chi\r\n                 17.00-20.00 Relaxbad\r\n\r\nLördag:          08.00-18.00 Bad\r\n\r\nSöndag:          10.00-11.00 Vattengympa\r\n\r\n\r\n\r\nPRISER\r\nÅrskort 1400 kr\r\nEnkelt bad 50 kr\r\nRabattkort 12 gånger 400 kr\r\nSimskola barn 8 x 30 min  700 kr\r\nSimskola vuxen 8 x 45 min  1475 kr\r\nUthyrning 700 kr/timme",
