        "Value": "Här finns flera spår av olika längd:\r\nGula elljusspåret 5 km\r\nRöda elljusspåret 3 km\r\nV-spåret 8,15 km\r\nGrön-vita spåret 5,8 km\r\nGul-vita spåret 3,9 km\r\nRöd-vita spåret 2,7 km\r\n\r\nSe vidare karta nedan. Vintertid förekommer spontan skidåkning i Grimsta naturreservat. Stadsdelsförvaltningen gör dock inte i ordning spår för skidåkning.\r\n\r\nFelanmälan av till exempel belysning kontakta Trafik Stockholm: www.stockholm.se/felanmalan telefon 08-651 00 00.",
