        "Value": "I Grimsta naturreservat kan du välja mellan flera olika motionsslingor, varav två är elljusspår. Det kortaste är under 3 km och det längsta går över 8 km. Start vid Kaananbadet eller i skogsbrynet söder om Grimsta Idrottsplats. På vintern förekommer spontan skidåkning inom naturreservatet.",
