        "Description": null,
        "Group": "Beskrivning av enheten",
        "GroupDescription": null,
        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Sommartid har vi en beachvolleyplan. Den är bokningsbar men övrig tid är den öppen för spontanidrott. Bokar du en tid, ta med din bokningsbekräftelse.\r\n\r\nAktiviteter \r\nFotboll och amerikansk fotboll, Boule, Beachvolleyboll, Lacrosse endast träning, jogging/löpning på allvädersbanor, motionsslinga. \r\n\r\nVintertid ishockey, skridskodisko. \r\nOBS! Spolning av naturis kommer att ske på Skarpnäcks Sportfält efter att grusplanerna anlagts till konstgräsplaner.\r\n\r\nVinterfotboll\r\nKonstgräsplanerna är bokningsbara året runt när vädret tillåter men planerna snöröjes ej.\r\n\r\nServeringen drivs av Bagarmossen Kärrtorp BK och är öppen varje dag.\r\nFör öppettider se; www.bkbk.se\r\n\r\nFör mer information om allmänhetens skridskoåkning, www.stockholm.se/skridsko \r\n\r\nSkarpnäcks OL bedriver orientering, skidåkning, löpning m.m. för unga och vuxna. Samling vid klubblokalen ( stora byggnaden längst in på idrottsplatsen) tisdagar kl. 17.45\r\n\r\nT-bana grön linje till Kärrtorp eller Björkhagen.",
