        "Value": "Du hittar här samma redskap som på våra utegym i tex Björkhagen och Ågesta. Vi har dock valt att göra stockarna aningen lättare för att bättre tillgodose den målgrupp som rör sig mest frekvent i området. \r\nObservera att det alltså rör sig om två separata stationer utmed Årstaviken på Årsta sidan. En nedanför Årsta IP och en nedanför Årstagårdens bollplan. Det är drygt en kilometer mellan de två stationerna. Vid stationen närmast järnvägsbron hittar ni armgång, latsdrag, marklyft, bröstpress, situps och stubbar för bla upphopp. Vid stationen närmare Skanstullsbron hittar ni knäböj, dips, chins och axelpress.",
