        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Ta med eget hänglås till kläd- och förvaringsskåp eller köp ett i receptionen för 30 kronor.\r\n\r\nSom inte minst framgått i massmedierna har anmälningarna och rapporterna om sexuella ofredanden på Eriksdalsbadet under den senaste tiden dessvärre ökat. Polisen har på relativt kort tid tagit emot över 20 anmälningar från i huvudsak flickor som ofredats. Från Eriksdalsbadets och Stockholms stads sida ser vi mycket allvarligt på detta och genomför en rad åtgärder i samarbete med polisen. Alla besökare, inte minst barn och unga, ska uppleva Eriksdalsbadet som tryggt och trevligt.",
