        "GroupDescription": null,
        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Beckomberga sim- och idrottshall är Stockholms centrum för handikappidrott och har därför god tillgänglighet för personer med funktionsnedsättning.\r\n\r\nVi har en 25-metersbassäng med vattentemperatur på 31-32 grader. \r\nTerapibassäng (höj- och sänkbar) med vattentemperatur på 32-34 grader. \r\nBubbelpool med vattentemperatur på 35-36 grader. \r\nVi har anpassade omklädningsrum samt lift i/ur bassängerna.\r\n\r\nIdrottshall: 17 X 36 meter\r\n\r\nDet är viktigt att göra något roligt på sin fritid, för då mår man mycket bättre. \r\nMotionskurser för personer som har en funktionsnedsättning finns på flera av Stockholms stads simhallar. Även på Beckomberga.\r\nFölj länken så får du veta mer: \r\nhttp://www.stockholm.se/KulturFritid/Simma-och-trana/Trana-inomhus/Information-aktivitet/Aktiviteter-for-dig-som-bor-i-gruppbostad/",
