        "GroupDescription": null,
        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Zinkensdamms IP invigdes 1937 och är idag en av landets mest frekventerande idrottsplatser. Anläggningen används i princip dagligen, året runt av allmänheten, närliggande skolor och föreningslivet. Det officiella publikrekordet på Zinkensdamm är 11 543 åskådare som såg det allsvenska fotbollskvalet 1941 mellan Reymersholm och IFK Eskilstuna, polisen uppskattade dock åskadarantalet tillsammans med de omgivande gatorna upp till 17 000 personer. När publikrekordet gäller konserter så såg 18 000 personer, Lars Winnerbäck avsluta sin sommarturné 2006 på Zinkensdamms IP.\r\n\r\nFör mer information om allmänhetens skridskoåkning, www.stockholm.se/skridsko",
