        "Name": "Mer om enheten",
        "Value": "Stigen är cirka fyra kilometer lång och går genom både grönska och asfalt. Längs vägen finns 15 skyltar om Hjorthagens natur, kultur och historia. Stigen har funnits sedan 2001 och har under 2014 utvecklats utifrån dialog med boende i området. \r\n\r\nVarje skylt längs stigen innehåller en fråga riktad till barn. Svaren finns på skylten som följer - ett spännande sätt för familjer och skolklasser att upptäcka Hjorthagen och Norra Djurgårdsstaden. \r\n\r\nLängs stigen finns ett utegym, som ligger i Hjorthagsparken nedanför Dianavägen 30.",
