        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Av de av Idrottsförvaltningens förvaltade skidspår prioriteras Ågesta friluftsområde först och främst då utrustning och maskinpark finns i anslutning till detta område. \r\nSå fort vädret tillåter spåras sedan Kärrtorpsspåret. Därefter Björkhagsslingan och sist Hammarbyrundan. Denna prioriteringsordning är satt efter vart det är enklast att spåra med pistmaskin.\r\nUnderlaget på våra skidspår är grus i alla fall utom på skogs-femman i Ågesta.\r\n\r\nSkidspåren iordningställs och underhålls av Läktare & evenemangsservice och du hittar alltid den senaste informationen om spårstatus på deras hemsida: www.laktare.com\r\n\r\nÄven skidspåren vid Hellasgården tillhör Nackareservatets skidspår men dessa driftas av Hellasgårdens egna personal och deras information hittar ni på: http://www.hellasgarden.se/sv/",
