        "Name": "Mer om enheten",
        "Value": "Husby ishall stod färdig år 2001 och byggdes för att ersätta det gamla Kista IP. Utöver ishallen så ansvarar Husby ishall över Akalla Gårds BP (naturgräs) Granby BP (naturgräs och cricket), Kvarnbacka BP (konstgräs, basketplan, 60m löparbana, längdhopp och boule), Ärvinge BP (konstgräsplan med läktare), Knutby BP (konstgräsplan med läktare),  Dalhagens BP (grusplan som även har en volleybollplan, basketplan, längdhopp), Stenhagens BP (grusplan samt längdhopp) och Hjulsta BP (grusplan). \r\nIshallen som är en av Stockholms fräschaste har 4 st stora omklädningsrum, 2st domarrum och parkering med plats för ca 70 bilar.\r\n\r\nFör mer information om allmänhetens skridskoåkning, www.stockholm.se/skridsko",
