        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "Det nya utegymmet är utformat för att kunna utveckla och träna kroppens sju grundrörelser; höftfällning, knäböj, utfall, press, drag, rotation och gå/springa. Exempel på utrustning är chinsräcke, ringar för armgång, hoppstubbar och sit-up bräda. På platsen finns skyltar med information om hur redskapen används.\r\n\r\nAll träningsutrustning ska kunna fungera för alla former av kroppsviktsträning, från nybörjare till mer avancerad. Den syftar till att stärka och förbättra rörlighet – kondition – uthållighet – styrka – snabbhet – explosivitet – smidighet – koordination – precision och balans.\r\n\r\nUtomhusgymmet är tillgänglighetsanpassat.",
