        "Value": "Öppettider för sommaren 2017\r\ngäller perioden 12 juni till och med 20 augusti\r\n\r\nMåndag:   06:30-20:00\r\nTisdag:   15:00-20:00\r\nOnsdag:   06:30-20:00\r\nTorsdag:  15:00-20:00\r\nFredag:   06:30-11:00\r\nLördag:   STÄNGT\r\nSöndag:   10:00-15:00",
