        "Value": "Avvikelser kan ske, detta meddelas med anslag på anläggningen samt här på webbsidan under avvikande öppettider samt aktuellt. \r\n\r\nStora bassängen:\r\nMån 06:30–21:30\r\n10:00–15:40*, 17:25–21:00*\r\n\r\nTis 06:30–19:00\r\n08:00-18:15*\r\n\r\nOns 06:30–20:30 \r\n08:00-15:40*, 18:30-19:15*\r\n\r\nTors 10:00–21:30\r\n18:15–19:00* 19:00–21:00 lugn musik\r\n\r\nFre 06:30–19:00 \r\n06:30–09:30 lugn musik, 09:30–15:40*\r\n\r\nLör 10:00–16:30 \r\n10:30-11:15* 15:00-16:30*\r\n\r\nSön 10:00–15:30\r\n12:00–14:30**\r\n\r\n*Endast motionssim och vattengympa eller annan aktivitet. Möjlighet till lekbanor finns ej, snabbana finns enbart vid möjlighet, den är inte garanterad.\r\n**Lektid, inga linor finns i bassängen, motionssim och snabbsim erbjuds ej\r\n\r\nLilla bassängen:\r\nMån  06:30–11:40, 18:30–21:30\r\n\r\nTis  06:30–08:00, 11:00-12:00\r\n\r\nOns  06:30–08:00, 15:40–20:30\r\n\r\nTors 10:00–16:00, 19:10–21:30\r\n\r\nFre  06:30-10:30\r\n\r\nLör  10:45–16:20\r\n\r\nSön  10:00–15:00\r\n\r\nÖvriga tider är det simundervisning i lilla bassängen och möjlighet till bad i denna finns ej.\r\n\r\nGym:\r\nMån 06:30–21:30\r\nTis 06:30-21:30\r\nOns 06:30-21:30\r\nTor 10:00–21:30\r\nFre 06:30–20:00\r\nLör 10:00–16:30\r\nSön 10:00–18:30\r\n\r\nMåndag–onsdag 09:00–12:00 samt fredag 09:00–12:00 är du som förälder välkommen att ta med din bebis till gymmet, sittandes i bärbar bilstol, babysitter eller motsvarande.",
