        "GroupDescription": null,
        "Id": "Description",
        "Name": "Mer om enheten",
        "Value": "På sommaren har vi en beachvolleyplan. Öppen för alla, spontanidrottsyta.\r\n\r\nLäs om aktuella tider för allmänhetens skridskoåkning på www.stockholm.se/skridsko/tider   \r\n\r\nIdrottshallarna är bokningsbara för följande idrotter:\r\nhandboll, innebandy, basket, volleyboll och badminton. Ljudanläggning finns att tillgå i hallen.\r\nHall 3: 20 X 40 meter\r\nHall 4: 20 X 40 meter\r\n\r\nUtegymmet är alltid öppet för alla och ligger i anslutning till idrottsplatsen.\r\n\r\nVinterfotbollsplan februari-mars.",
