        "Value": "Under säsongen bedrivs en del fasta aktiviteter,  slalomskate. En del av anläggningen kan då vara avstängd för andra typer av skateåkning, men den fasta aktiviteten är öppen för alla. \r\n\r\nTjejskate på onsdagar 17:00-19:00\r\nFrån den 19 juni och fram tills det inte går att åka längre ordnar vi tjejskate. Det finns tjejledare och du kan låna bräda och skydd. Allt är gratis!\r\nhttp://www.subsurfers.se/ \r\n\r\nDe evenemang och aktiviteter som arrangeras i Högdalens skatepark ligger som nyheter på stadens webbplats: www.stockholm.se",
